import React from "react";
import { Link } from "react-router-dom";
import styles from "./Home.module.css"; // Importing CSS module

const Home = () => {
  return (
    <div className={styles['home-container']}>
      <h1>Welcome to the Attendance System</h1>
      <p>Please log in to start tracking your attendance.</p>

      <div className={styles['button-container']}>
        <Link to="/login">
          <button className={styles['login-btn']}>Login</button>
        </Link>
        <Link to="/dashboard">
          <button className={styles['dashboard-btn']}>Go to Dashboard</button>
        </Link>
      </div>
    </div>
  );
};

export default Home;
